import React from "react";

function Categories() {
  return (
    <div className="categories">
      <ul >
          <li><a href="/">Women</a></li>
          <li><a href="/">Men</a></li>
          <li><a href="/">Kids</a></li>
          <li><a href="/">Bags</a></li>
          <li><a href="/">Shoes</a></li>
      </ul>
    </div>
  );
}

export default Categories;
